        <div className='card'>
            <h1 className='info'>{name}</h1>
             {temperaments && typeof temperaments[0] === 'object'? temperaments?.map(t=>(
                <p key={t.name}>{t.name}</p>
            )):temperaments}
            <div>
                <img src={image} alt={`${name}`} width='250px' heigth='200px' className='imageDog'/>
            </div>

            <h3 className='info'>peso: {weightMin} kg</h3>
        </div>
    )
}
